div.div:
Динамический массив (также известный как вектор)- структура данных, представляющая собой автоматически расширяющийся массив (непрерывную гомогенную область памяти).
Динамический массив в подавляющем большинстве случаев размещается на куче, т.к. его размер неизвестен заранее.
Динамический массив в процедурном стиле можно представить в виде структуры, содержащую следующие поля:
Ex.
size - текущий размер вектора;
capacity - текущая вместимость вектора (размер выделенной области памяти);
growthFactor - множитель, на который умножается текущий capacity при расширении вектора для выделения новой области памяти;
vector - непосредственно область памяти, в которой располагаются элементы вектора;
